    setExpenses(expenses)
  }; 

  return (
    <div>
      <div className="Title-detail">Expense Tracker</div>
      <p>by Alex Schrader</p>

      <NewExpense onAddExpense={addExpenseHandler} />
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
